import React from "react";
import styled from "styled-components";

const Box = styled.div`
  display: flex;
  width: 500px;
  height: 500px;
  padding: 50px;
  border-radius: 50px;
  background: #aabda2;
`;

const Text = styled.div`
  color: #000;
  font-family: Roboto;
  font-size: 48px;
  font-style: normal;
  font-weight: 700;
  padding: 50px;
  box-sizing: border-box;
`;

export default function Project() {
  return (
    <Box>
      <Text>Project</Text>
    </Box>
  );
}
